<!doctype html><html><head><style type="text/css">table.excel {	border-style:ridge;	border-width:1;	border-collapse:collapse;	font-family:sans-serif;	font-size:11px;}table.excel thead th, table.excel tbody th {	background:#CCCCCC;	border-style:ridge;	border-width:1;	text-align: center;	vertical-align: top;}table.excel tbody th { text-align:center; vertical-align: top; }table.excel tbody td { vertical-align:bottom; }table.excel tbody td { 	padding: 0 3px; border: 1px solid #aaaaaa;	background:#ffffff;}table.excel tr { background: #ffffff; }table.excel tr:hover { color: #00008B; background-color: #ffff99; }table.excel tr:hover td { background-color: transparent; }</style></head><body>